function addBill(newBill) {
  console.log(newBill)
}

function computeRes(value, newBill) {
  console.log(value * newBill);
}

  return (
    <div>
      <Logo />
      <div className='parent'>
      <Bill 
      addBill = {addBill}
      />
      <Tip 
        onClick = {computeRes}
      />
      <People />
      </div>
    </div>
  );
}

export default App;
